import React, { Component } from 'react';
import { Container,Navbar,NavbarBrand} from 'reactstrap';

class Menu extends Component {
    render() {
        return (
            <div>
                <Navbar dark color="primary">
                    <image href="/" width="30px" height="30px"/>
                    <NavbarBrand>ISP HackerEarth</NavbarBrand>
                    <p>- searching ISP made easy</p>
                </Navbar>
                <div className="container"> ISP HackerEarth</div>
                <div></div>
            </div>
        );
    }
}

export default Menu;
